import React from 'react';
import NewCoinsTrackerCard from '../components/NewCoinsTrackerCard';
import WalletTrackerCard from '../components/WalletTrackerCard';
import VolumeTrackerCard from '../components/VolumeTrackerCard';
import TestWebSocket from '../components/TestWebSocket';
import WatchedCoinsCard from '../components/WatchedCoinsCard';

function Home() {
console.log('Home component mounted');
return (
<div className="min-h-screen bg-gray-50 dark:bg-gray-900 transition-colors duration-200">
    <div className="container mx-auto px-4 py-8">
    <div className="max-w-4xl mx-auto mb-12 text-center">
        <h1 className="text-4xl font-bold mb-4 text-gray-900 dark:text-white">Crypto Dashboard</h1>
        <p className="text-lg text-gray-600 dark:text-gray-300">Track your crypto assets, monitor market changes, and stay updated with the latest trends</p>
    </div>
    <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-8">
        <div className="transform transition-all duration-200 hover:scale-105">
        <NewCoinsTrackerCard />
        </div>
        <div className="transform transition-all duration-200 hover:scale-105">
        <WalletTrackerCard />
        </div>
        <div className="transform transition-all duration-200 hover:scale-105">
        <VolumeTrackerCard />
        </div>
        <div className="transform transition-all duration-200 hover:scale-105">
        <TestWebSocket />
        </div>
        <div className="transform transition-all duration-200 hover:scale-105">
        <WatchedCoinsCard />
        </div>
    </div>
    </div>
</div>
);
}

export default Home;
